import React from 'react'
import { Provider as StyletronProvider, DebugEngine } from "styletron-react";
import { Client as Styletron } from "styletron-engine-atomic";
import { Div, StyleReset, ThemeProvider, Button, Text, Container } from "atomize";


export default function Home() {
    return (
        <Div>
            <Text textSize="display2" textWeight="700">
                Welcome to <br />
                Dumb Donuts
            </Text>
            <Text textSize="display5">
            Dumb Donuts is a collection of 10,000 NFTs inspired from the works of CryptoPunks and Weird Whales.
            </Text>
        </Div>
    )
}
